// src/pages/TenantDashboard.jsx

import React, { useEffect, useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import api from "../services/api";
import TenantLeaseCard from "../components/TenantLeaseCard";
import TenantPayments from "../components/TenantPayments";
import LeasePhotosForm from "../components/LeasePhotosForm";
import DocumentsForm from "../components/DocumentsForm";

const TenantDashboard = ({ onLogout }) => {
  const navigate = useNavigate();
  const location = useLocation();
  const [user, setUser] = useState(null);

  useEffect(() => {
    const storedUser = localStorage.getItem("user");
    if (!storedUser) return navigate("/login");
    setUser(JSON.parse(storedUser));
  }, [navigate]);

  if (!user) return null;

  return (
    <div className="min-h-screen bg-[#F3F6FB] p-6 flex justify-center">
      <div className="w-full max-w-6xl">

        {/* TOP NAV BAR */}
        <div className="bg-[#0F172A] text-white rounded-xl p-4 flex items-center justify-between shadow-md">
          <div className="flex items-center gap-2">
            <img src="/icons/home.png" className="w-6 h-6" alt="" />
            <span className="font-semibold text-lg">Tenant Portal</span>
          </div>

          <div className="flex items-center gap-3">
            <button
              onClick={() => navigate("/profile")}
              className="px-4 py-1.5 bg-white/10 rounded-lg border border-white/20 hover:bg-white/20 transition"
            >
              Profile
            </button>

            <button
              onClick={() => navigate("/dashboard")}
              className="px-4 py-1.5 bg-white/10 rounded-lg border border-white/20 hover:bg-white/20 transition"
            >
              Dashboard
            </button>

            <button
              onClick={onLogout}
              className="px-4 py-1.5 bg-red-600 rounded-lg hover:bg-red-700 transition"
            >
              Logout â†’
            </button>
          </div>
        </div>

        {/* SUMMARY CARDS */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mt-6">
          {/* Next Rent */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="text-center">
              <img src="/icons/money-bag.png" className="w-8 mx-auto" alt="" />
              <h3 className="font-medium mt-2">Next Rent Due</h3>
              <p className="text-2xl font-bold mt-1">${user.nextRent || "1200.00"}</p>
            </div>
          </div>

          {/* Lease Ends */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="text-center">
              <img src="/icons/calendar.png" className="w-8 mx-auto" alt="" />
              <h3 className="font-medium mt-2">Lease Ends</h3>
              <p className="text-xl font-bold mt-1">{user.leaseEnd || "8/11/2024"}</p>
            </div>
          </div>

          {/* Payments Made */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="text-center">
              <img src="/icons/cash.png" className="w-8 mx-auto" alt="" />
              <h3 className="font-medium mt-2">Payments Made</h3>
              <p className="text-2xl font-bold mt-1">${user.totalPaid || "0.00"}</p>
            </div>
          </div>
        </div>

        {/* WELCOME */}
        <div className="mt-8">
          <h1 className="text-3xl font-bold">Welcome, {user.name}</h1>
          <p className="text-gray-600 mt-1">Role: tenant</p>
        </div>

        {/* MAIN GRID */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-5 mt-6">

          {/* Tenant Profile */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="flex items-center gap-2 mb-3 text-lg font-semibold">
              <img src="/icons/user-blue.png" className="w-5" alt="" />
              Tenant Profile
            </div>
            <p><strong>Name:</strong> {user.name}</p>
            <p><strong>Email:</strong> {user.email}</p>
          </div>

          {/* Payment History */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="flex items-center gap-2 mb-3 text-lg font-semibold">
              <img src="/icons/card.png" className="w-5" alt="" />
              Payment History
            </div>

            <button
              onClick={() => navigate("/payments")}
              className="mt-2 bg-blue-600 hover:bg-blue-700 text-white w-full py-3 rounded-lg text-lg font-semibold"
            >
              Make a Payment
            </button>
          </div>

          {/* Lease Information */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <TenantLeaseCard />
          </div>

          {/* Lease Photos Upload */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <LeasePhotosForm />
          </div>

          {/* Documents */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <DocumentsForm />
          </div>

          {/* Reminders */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="flex items-center gap-2 text-lg font-semibold">
              <img src="/icons/check-blue.png" className="w-5" alt="" />
              Reminders
            </div>
            <p className="mt-1">No reminders yet ðŸŽ‰</p>
          </div>

          {/* Smart Passcodes */}
          <div className="bg-white border rounded-xl p-5 shadow-sm">
            <div className="flex items-center gap-2 text-lg font-semibold">
              <img src="/icons/help.png" className="w-5" alt="" />
              Smart Passcodes
            </div>
            <p className="mt-1">No active passcodes</p>
          </div>

        </div>
      </div>
    </div>
  );
};

export default TenantDashboard;
